import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
    return (
        <nav>
            <ul>
                <li><Link to="/">Library</Link></li>
                <li><Link to="/reservations">Library</Link></li>
            </ul>
        </nav>
    );
}

export default Navbar;
